        <div className="layout coldis">
            <div className="displaysets">
                <div className="set">
                    <a href="http://localhost:3000"><img src={logo} className="images" alt="Logo of ApiFlash, the website screenshot API"></img>
                        <div className="title">
                            <span className="font-weight-light">API</span><b className="ml-1">FLASH</b>
                        </div>
                    </a>
                </div>
                <div>

                </div>

            </div>
        </div>
    )
}
export default Footer;
